#!/bin/python3

import binascii

if __name__ == "__main__":
    # use unhexlify to convert our bytes string into raw bytes
    data = binascii.unhexlify("")

    # set our initial prev value
    prev = 88

    # decode each byte one by one and update prev.  Print the result as we go.
    for byte in data:
        prev = byte ^ prev
        print(chr(prev), end="")
